```c
if (values != NULL) {
    if (values->embedded == 0) {
        for (i = 0, n = mp->ma_keys->dk_nentries; i < n; i++) {
            Py_XDECREF(values->values[i]);
        }
        free_values(values, false);
    }
    dictkeys_decref(interp, keys, false);
