responded: Based on the code review, the problem is this:  
- `dictkeys_decref()` may access memory pointed at by `keys`.
- In split-table mode with non-embedded values, `keys` and `values` are allocated separately, so freeing `values` is safe.
- However, if *embedded* values are used, freeing `values` may also free the memory for `keys` (or vice versa). But the dealloc code only checks for `values->embedded == 0` (i.e., non-embedded case).

But the sanitizer trace shows use-after-free is happening during `dictkeys_decref`, so it's likely that in some cases, `keys` is pointing to memory that is already freed (possibly by `free_values`).

**Hypothesis:**  
We should not call `dictkeys_decref` if `values->embedded == 0` and `keys` is part of the same block as `values`.  
The correct deallocation order is:
- If `values` is non-embedded (i.e., `values->embedded == 0`), then:
  - Decref all value objects.
  - Free `values`.
  - Do *not* decref `keys` (since they are owned/freed with `values`).
- If `values` is embedded or `NULL`, then:
  - Decref `keys` as usual.

Let's implement this logic, which can be found in some upstream Python fixes for similar bugs.  
**Patch:**
```diff
@@ -3172,13 +3172,18 @@
